ore._UZ(80,"iframe",18),core.qZA(),core.TgZ(81,"p"),core._uU(82,"That tagline is also the key selling point ? The only people that are allowed to speak there this time around are rookie speakers ! (ie. people who've never spoken anywhere before)."),core.qZA(),core.TgZ(83,"p"),core._uU(84,"After some nudging in the first few days (done to me, not by me), I submit a CFP titled 'Securely storing and transmitting information on mobile/IoT devices: A story in development' (which can be found "),core.TgZ(85,"a",19),core._uU(86,"here"),core.qZA(),core._uU(87,")."),core.qZA(),core.TgZ(88,"p"),core._uU(89,"A week or two pass by, and I get the answer ! My CFP was accepted !"),core.qZA(),core.TgZ(90,"p"),core._uU(91,"Wooohooo !"),core.qZA(),core.TgZ(92,"div",20),core._UZ(93,"ngx-tweet",21),core.qZA(),core._UZ(94,"br"),core.TgZ(95,"h4",22),core._uU(96,"Oh shit I now need to write the damned thing."),core.qZA(),core.TgZ(97,"p"),core._uU(98,"Apparently, choosing a subject as vast as 'the entirety of secure storage and transmission for IoT and mobile devices' is not necessarily a 300 IQ move, especially not for a rookie speaker."),core.qZA(),core.TgZ(99,"p"),core._uU(100,"I get into writing the talk, mostly using my CFP as a guiding board, and manage to divide the flow of it into 5 parts:"),core.qZA(),core.TgZ(101,"ul")(102,"li"),core._uU(103,"Where ? - The scope of the problem and how I relate to it."),core.qZA(),core.TgZ(104,"li"),core._uU(105,"What ? - The terminology and ideas that comprise the subject."),core.qZA(),core.TgZ(106,"li"),core._uU(107,"Why ? - The people, the technology, the risks and incident fallout."),core.qZA(),core.TgZ(108,"li"),core._uU(109,"How ? - Fixing the problem."),core.qZA(),core.TgZ(110,"li"),core._uU(111,"Wait, say again ? - An overview of things I'd heard in the field."),core.qZA()(),core.TgZ(112,"p"),core._uU(113,"Mind you, I only have 30 minutes to talk about all of this. So I time myself saying the things, and I manage to cram in 47 slides."),co